- input: "TEXT\x1CC00444323\x1C.TEXT\x1C\x1CF3A\x1CThe report is being amended in
    response to a letter received from the FEC dated March 9, 2009.  The original
    report attempted to report a consolidation of all of the outstanding candidate
    loans as well as accrued interest on those loans.  As part of the consolidation,
    the electronic software showed the payments of the loans as expenditures and the
    creation of the new loan as a contribution.  As such, it appeared that the candidate
    loans had been paid off in excess of $250,000 for each election.  We have amended
    the report and decided against consoldiating the notes. The consolidation was
    done for internal record keeping purposes.  \n"
